 function getContestData(){
  const Data =  fetch('https://kontests.net/api/v1/all')
  const Contest =  Data.json();
  return Contest;
}

async function App() {
  const Data = await fetch('https://kontests.net/api/v1/all')
  const Contest = await Data.json();
  var ret = " ";
  for(let info in Contest)
  {
    console.log(info);
  }
  return Contest[0].name;
}

export default App;
